interface infoProduct {
  image: string;
  name: string;
  price: number;
  description: string;
}
export const Card = ({ image, name, price, description }: infoProduct) => {
  return (
    <div>
      <img src={image} />
      <p>{name}</p>
      <label>Preço: R${price}</label>
      <label>Descrição:{description}</label>
    </div>
  );
};
